import './comp.css';
export default function Header(){
    return(
        <header className='header'>
            <nav>
                <ul>
                    <li><a href='Products'></a></li>
                    <li><a href='About'></a></li>
                    <li><a href='Login'></a></li>
                    <li><a href='Sign'></a></li>

                </ul>
            </nav>

        </header>
    )
}
